  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Klamath
  Basin National Wildlife Refuge Complex outlines Refuge accomplishments during the
  1995 calendar year. The Tule Lake National Wildlife Refuge report begins with a
  summary of the year's highlights and weather conditions. The report includes a planning
  section which discusses management planning, public participation, compliance with
  environmental and cultural resource mandates, and research and investigations. Refuge
  administration is outlined; information about personnel, volunteer programs, funding,
  and safety is given. Habitat management is also covered; subjects include wetlands,
  croplands, grasslands, other habitats, fire management, pest control, water rights,
  Farmers Home Administration (FHA) conservation easements, and private lands. The
  wildlife section of the report discusses wildlife diversity, endangered and threatened
  species, waterfowl, marsh birds and waterbirds, shorebirds, raptors, other migratory
  birds, game mammals, other resident wildlife, animal control, marking and bird banding,
  and disease prevention and control. The public uses of the Refuge described in this
  report include outdoor classrooms, interpretive programs, hunting, wildlife observation,
  other wildlife oriented recreation, picnicking, law enforcement, and cooperating
  associations. The equipment and facilities section of the report provides information
  about new construction, rehabilitation, communications systems, and computers. Cooperative
  programs are provided at the end. Narrative reports for Lower Klamath, Clear Lake,
  Upper Klamath, Bear Valley, and Klamath Marsh National Wildlife Refuge are included.\",\n\t\"owner_org\":
